import React from 'react';
import './zkFoils.css';  // Import the corresponding CSS

function ZkFoils() {
  return (
    <div className="zk-foils-container">
      <div className="zk-foils-image">
        <img src="/images/zk-foils.jpg" alt="ZK Foils" />
      </div>
      <div className="zk-foils-description">
        <h2>ZK Foils</h2>
        <p>ZK Foils is a leading manufacturer of flexible packaging materials, specializing in foil-based solutions that cater to various industries.</p>
      </div>
    </div>
  );
}

export default ZkFoils;
